import React, { PureComponent } from 'react';
import ReactEcharts from 'echarts-for-react';

export default class HomeChartRight extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
        };
    }
	getROption = () => {
		let op = {
			 xAxis: {
				type: 'category',
				data: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun']
			},
			yAxis: {
				type: 'value'
			},
			series: [{
				data: [820, 932, 901, 934, 1290, 1330, 1320],
				type: 'line'
			}]
			
		}
		return op;		
	}
	
    render() {
        return (
			<div>
				<div className="title1">游客实时数据</div>
				<div className="a1">
					<ReactEcharts option={this.getROption()} style={{height:'100px',width:'20px'}}></ReactEcharts>
				</div>
			</div>
        );
    }
}
